DROP TABLE iF EXISTS ##PostWithInterestCredit
;WITH CTE
AS
(
	SELECT BP.acctId, BP.AccountNumber, T1.AccountUUID, MergeInProcessPH, T1.TranID, Amount, TranTime, 
	CAST(0 AS MONEY) FINAL_INT_CR_AMT, ROW_NUMBER() OVER (PARTITION BY AccountNumber, TranID ORDER BY TranTime) [rank]
	FROM #TempRecords T1
	JOIN BSegment_Primary BP WITH (NOLOCK) ON (T1.AccountUUID = BP.UniversalUniqueID)
)
SELECT acctId, AccountNumber, AccountUUID, MergeInProcessPH, TranID, Amount, TranTime, FINAL_INT_CR_AMT
INTO ##PostWithInterestCredit
FROM CTE
WHERE [Rank] = 1

DROP TABLE IF EXISTS ##PostWithInterestCredit_Merge
SELECT T1.acctId, T1.AccountNumber SourceAccountNumber, T1.AccountUUID SourceAccountUUID, M1.TransmissionTime MergeDate, BP.DateAcctOpened DESTDateAcctOpened,
T1.TranID, t1.Amount, T1.TranTime,
DestBSAcctId, DestAccountNumber, DestBSAccountUUID, AcrossPODMerge, FINAL_INT_CR_AMT SRC_FINAL_INT_CR_AMT, CAST(0 AS MONEY) DEST_FINAL_INT_CR_AMT, CAST(0 AS MONEY) FINAL_INT_CR_AMT
INTO ##PostWithInterestCredit_Merge 
FROM ##PostWithInterestCredit T1
JOIN LS_PRODDRGSDB01.ccgs_coreissue.dbo.MergeAccountJob m1 WITH (NOLOCK) ON (T1.acctId = M1.SrcBSAcctId)
JOIN BSegment_Primary BP WITH (NOLOCK) ON (BP.acctId = M1.DestBSAcctId)
WHERE T1.MergeInProcessPH IS NOT NULL AND T1.MergeInProcessPH = 4
--AND T1.TranTime < BP.DateAcctOpened

DROP TABLE IF EXISTS ##PostWithInterestCredit_Merge_AcrossPOD
SELECT T1.acctId, T1.AccountNumber SourceAccountNumber, T1.AccountUUID SourceAccountUUID, M1.TransmissionTime MergeDate,
T1.TranID, t1.Amount, T1.TranTime,
DestBSAcctId, DestAccountNumber, DestBSAccountUUID, AcrossPODMerge, FINAL_INT_CR_AMT SRC_FINAL_INT_CR_AMT, CAST(0 AS MONEY) DEST_FINAL_INT_CR_AMT, CAST(0 AS MONEY) FINAL_INT_CR_AMT
INTO ##PostWithInterestCredit_Merge_AcrossPOD 
FROM ##PostWithInterestCredit T1
JOIN LS_PRODDRGSDB01.ccgs_coreissue.dbo.MergeAccountJob m1 WITH (NOLOCK) ON (T1.acctId = M1.SrcBSAcctId)
WHERE T1.MergeInProcessPH IS NOT NULL AND T1.MergeInProcessPH = 14
--AND T1.TranTime < BP.DateAcctOpened

SELECT * FROM ##PostWithInterestCredit_Merge_AcrossPOD

