DROP TABLE IF EXISTS #TempPosted
SELECT AccountNumber, AccountUUID, SUM(Amount) Amount, SUM(FINAL_INT_CR_AMT) FINAL_INT_CR_AMT
INTO #TempPosted
FROM ##PostWithInterestCredit
WHERE MergeInProcessPH IS NULL
GROUP BY AccountNumber, AccountUUID


SELECT RTRIM(T1.AccountNumber) AccountNumber, T2.AccountUUID, T2.Amount TotalTransactionAmount, T2.FINAL_INT_CR_AMT, T1.Amount PostedAmount
FROM ##TempRecords T1
JOIN #TempPosted T2 ON (T1.AccountNumber = T2.AccountNumber)
